INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div id="welcome-wrapper">Welcome, NEHGS</div>', 'Welcome note block', 'full_html'),
(2, '<div id="footer-addr-wrapper"><b>New England Historic Genealogical Society</b><br>99-101 Newbury St. | Boston, MA | 02116, USA<br><b>888-296-3447</b><div class="privacy-policy-links"><ul><li><a alt="Privacy Policy" href="http://www.americanancestors.org/Privacy-Policy.aspx" title="Privacy Policy">Privacy Policy</a></li><li><a alt="Terms and Conditions" href="http://www.americanancestors.org/Terms-and-Conditions.aspx" title="Terms and Conditions">Terms and Conditions</a></li><li><a alt="Privacy Policy" href="http://www.americanancestors.org/Membership/member-faq/" title="Privacy Policy">FAQ</a></li></ul></div><a alt="Mass Culture Council" class="mcc-logo" href="http://www.massculturalcouncil.org/" target="_blank">Massachusetts Culture Council</a></div>', 'Footer Address block', 'full_html'),
(3, '<div id="ftr-faq-blk-wrapper"><div class="faq-blog-link"><a alt="Faq" href="http://www.americanancestors.org/Membership/member-faq/" target="_blank">FAQ</a><a alt="Blog: Vita-Brevis" href="http://vita-brevis.org/" target="_blank">Blog: Vita-Brevis</a></div><div class="signup-btn"><a alt="Sign up for e-newsletter" href="http://visitor.r20.constantcontact.com/manage/optin?v=0018qhVFXyt4BgPAAzkxj_-YgFrjVefXVHurjnmVyRg8cTfDkxtD8W9cCm1Y3yQkcQEdxdxRQwwW8Gf8Ud99FQ2TUH0pAn344T61B1-RSKRANjG9BjT8OJZE88aruDvqBb5-AbBNjgnLqsXyU6EUgZZiKB7TWhi7Fpq60GbR3mIq4ZWWXjPhObEuR8gVZoaCyhfd8BQQPU6XXs%3D" target="_blank">Sign up for our e-newsletter</a></div><div class="social-icons"><a alt="Twitter" class="twitter sc-icon" href="https://twitter.com/AncestorExperts" target="_blank">Twitter</a><a alt="Facebook" class="facebook sc-icon" href="https://www.facebook.com/nehgs" target="_blank">Facebook</a><a alt="Flickr" class="flickr sc-icon" href="https://www.flickr.com/photos/110664726@N08/" target="_blank">Flickr</a></div></div>', 'Footer faq block', 'full_html'),
(4, '<div id="frnt-pg-tab-wrapper"><div class="left-container" id="srch"><div class="tab-header-title">WHAT CAN I DO?</div><ul><li><a class="search_detail"> <span>SEARCH BY EXPERT OR AREA OF EXPERTISE</span> </a></li><li><a class="free_estimate_detail"> <span>GET A FREE ESTIMATE</span> </a></li><li><a class="talk_expert_detail"> <span>TALK TO AN EXPERT</span> </a></li><li><a class="research_service_detail"> <span>ORDER RESEARCH SERVICES</span> </a></li></ul></div><div class="right-container"><div class="tab-header-title">WHAT DOES THIS MEAN?</div><ul><li id="search_detail"><div>Search by Not sure what you need or how much it might cost? We are happy to provide you with a free initial estimate before 44— you engage in research services.</div><div>Please keep in mind that this is only an estimate.</div><div class="get-str-link"><a href="experts">Get Started</a></div></li><li id="free_estimate_detail"><div>Get a free Not sure what you need or how much it might cost? We are happy to provide you with a free initial estimate before 44— you engage in research services.</div><div>Please keep in mind that this is only an estimate.</div><div class="get-str-link"><a href="experts">Get Started</a></div></li><li id="talk_expert_detail"><div>Talk to expert Not sure what you need or how much it might cost? We are happy to provide you with a free initial estimate before 44— you engage in research services.</div><div>Please keep in mind that this is only an estimate.</div><div class="get-str-link"><a href="experts">Get Started</a></div></li><li id="research_service_detail"><div>Research service Not sure what you need or how much it might cost? We are happy to provide you with a free initial estimate before 44— you engage in research services.</div><div>Please keep in mind that this is only an estimate.</div><div class="get-str-link"><a href="experts">Get Started</a></div></li></ul></div></div>', 'Links Details', 'full_html'),
(7, '<div class="sticky-btn-wrapper">\r\n<ul class="sticky-btns">\r\n<li class="btn-row row1">\r\n<div class="sticky-btn-icon"><i class="icon icon-search-by-expert fa fa-user"></i></div>\r\n<a href="#block-multiblock-2" class="icon-anchor">\r\n<span class="sticky-btn-label label-search-by-expert"><span>Search by expert or area of expertise</span></span>\r\n</a>\r\n</li>\r\n<li class="btn-row row2">\r\n<div class="sticky-btn-icon"><i class="icon icon-get-free-est fa fa-microphone"></i></div>\r\n<a href="http://www.americanancestors.org/Services/Hire-a-Researcher/" target="_blank" class="icon-anchor">\r\n<span class="sticky-btn-label label-get-free-est"><span>Hire a Lecturer</span></span>\r\n</a>\r\n</li>\r\n<li class="btn-row row3">\r\n<div class="sticky-btn-icon"><div class="two-icon-wrapper"><i class="icon user-face1 icon-talk-to-an-expert fa fa-user"></i><i class="icon user-face2 icon-talk-to-expert-second fa fa-user"></i></div></div>\r\n<a href="http://www.americanancestors.org/Services/Consultations/" target="_blank" class="icon-anchor">\r\n<span class="sticky-btn-label label-talk-to-an-expert"><span>Talk to an expert</span></span>\r\n</a>\r\n</li>\r\n<li class="btn-row row4">\r\n<div class="sticky-btn-icon"><i class="icon icon-ord-res-service fa fa-pencil"></i></div>\r\n<a href="http://www.americanancestors.org/Services/Hire-a-Researcher/" target="_blank" class="icon-anchor">\r\n<span class="sticky-btn-label label-ord-res-service"><span>Order research services</span></span>\r\n</a>\r\n</li>\r\n</ul>\r\n</div>', 'Left side sticky buttons', 'php_code'),
(8, '<?php \r\n\r\nglobal $base_url;\r\n  $link = $base_url . ''/expertise'';\r\n\r\n?>\r\n<div class="view-tag-link-wrapper"><div class="view-tag"><a href= "<?php echo $link; ?>" title="View all topics" >View all topics</a></div></div>\r\n', 'View all topics - inner page link', 'php_code'),
(9, '<div id="disclaimer-wrap"><p>NEHGS will match your request with an available and qualified expert from our staff. Please do not contact experts directly.</p></div>', 'Disclaimer text', 'full_html');
