INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'ct_quote', 0, 5, 5, 'und', 0, '<p>I was able to discover and document my whole family back to 1066 with the help of NEHGS researchers. What a truly amazing experience!</p>', '', 'full_html'),
('node', 'ct_quote', 0, 6, 6, 'und', 0, '<p>What a truly amazing experience!</p>', '', 'full_html'),
('node', 'ct_quote', 0, 7, 7, 'und', 0, '<p>whole family back to 1066 with the help of NEHGS researchers</p>', '', 'full_html'),
('node', 'ct_publications', 0, 9, 9, 'und', 0, '<p>Where did your ancestors go from New England? Anna will present her analysis of migration patterns out of New England to Ohio, Pennsylvania and other territories.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 35, 35, 'und', 0, '<p>What to do when you need records that were destroyed, co-authored with Henry Louis Gates, Jr.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 36, 36, 'und', 0, '<p>An investigation into a family that owned slaves, co-authored with Henry Louis Gates, Jr.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 37, 37, 'und', 0, '<p>Now in its fifth edition, this handbook is an indispensable resource for anyone doing research in Connecticut, Maine, Massachusetts, New Hampshire, Rhode Island, and Vermont.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 38, 38, 'und', 0, '<p>Published more than 125 years ago, this important resource compiles documents listing seventeenth-century English immigrants to New England, the Chesapeake, and the Caribbean</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 39, 39, 'und', 0, '<p>During the 18th and 19th centuries, many New England settlers pulled up stakes and left. Find out where they went, and learn more about patterns of migration in early America.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 40, 40, 'und', 0, '<p>Learn about social constraints on sexual behavior in colonial America.</p>', '', 'filtered_html'),
('node', 'ct_webinar', 0, 41, 41, 'und', 0, '<p>During the 18th and 19th centuries, many New England settlers pulled up stakes and left. Find out where they went, and learn more about patterns of migration in early America.</p>', '', 'filtered_html'),
('node', 'ct_webinar', 0, 42, 42, 'und', 0, '<p>Probate, court and other records can contain a great deal of useful information. Find out how to use them to your best advantage.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 44, 44, 'und', 0, '<p>Rhonda is a nationally recognized genealogist specializing in New England research and celebrity research as well as computerized genealogy, and a contributing editor for Heritage Quest magazine. Rhonda is a nationally recognized genealogist specializing in New England research and celebrity research as well as computerized genealogy, and a contributing editor for Heritage Quest magazine.&nbsp;</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 45, 45, 'und', 0, '<p><span style="font-size: 13.008px; line-height: 20.0063px;">Where did your ancestors go from New England? Anna will present her analysis of migration patterns out of New England to Ohio, Pennsylvania and other territories.</span></p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 46, 46, 'und', 0, '<p>Test Publication by editor body</p>', '', 'filtered_html'),
('node', 'ct_quote', 0, 48, 48, 'und', 0, '<p>Thank you very much for all the time and effort you gave my research request. The info you provided has helped me figure where to focus my search.</p>', '', 'full_html'),
('node', 'ct_quote', 0, 49, 49, 'und', 0, '<p>I want to thank you and your staff for the great job you did on my family tree.</p>', '', 'full_html'),
('node', 'ct_quote', 0, 50, 50, 'und', 0, '<p>Thank you so much- the material you sent provides exactly the connection for a second great grandmother who I was looking for. One by one, I’m identifying the families of all the unidentified women in the family!</p>', '', 'full_html'),
('node', 'ct_quote', 0, 51, 51, 'und', 0, '<p>The NEHGS has verified a long held belief that I am a descendent of Roger Williams founder of Rhode Island. Prominent in this research was Zachary Garceau. What prompted this research was a comment by my grandson. “How do you know I’m related to Roger Williams?” I never had any real proof that my middle “Williams” was there because I was descended from Roger Williams. With Zachary’s thorough research that connection to Roger Williams has been made. Please pass to Zachary my appreciation for the terrific job he has done.</p>', '', 'full_html'),
('node', 'ct_quote', 0, 52, 52, 'und', 0, '<p>I can’t thank you enough for the great advanced pointers I got.</p>', '', 'full_html'),
('node', 'ct_quote', 0, 53, 53, 'und', 0, '<p>You are great. The time you spent with us cleared up years of misinformation.</p>', '', 'full_html'),
('node', 'ct_quote', 0, 54, 54, 'und', 0, '<p>There were several goose bump moments for me. I feel that I can continue on with your many good hints.</p>', '', 'full_html'),
('node', 'experts', 0, 55, 55, 'und', 0, '<div>He joined NEHGS as a full-time genealogical researcher in 2014 from a career in foreign and public policy analysis, primarily in campaigns and non-profits, and a home-grown business as a genealogical researcher. He is a facilitator in Boston University''s Genealogical Research Certificate Program of which he is also an alumnus. His commentary appeared in print and new media sources and he made appearances on CNN. &nbsp;He has also worked for the U.S. Institute of Peace and in program development for the Archdiocese of Newark, having previously worked for the USCCB Confraternity of Christian Doctrine. &nbsp;</div><div>A graduate of Georgetown University’s foreign service program and graduate coursework at the Elliott School of International Affairs, Lee is a fluent speaker of several languages who is active in the European hereditary community, including the Corpo della Nobilta’ Italiana. He volunteers with charitable organizations including Mustard Seed Communities, Aid to the Church in Need, the Saint Bernard Project, the Indian Health Service, the Tekakwitha Conference, and other disaster-relief and foreign-service charities. &nbsp;He facilitates a biweekly Boston homeless effort and additional service for the Sovereign Order of Malta.</div>', '', 'filtered_html'),
('node', 'ct_resource', 0, 56, 56, 'und', 0, '<p>The preeminent resource for Maryland research, MdHS was founded by the Society of the Cincinnati of Maryland in 1844 and became the principal repository for Proprietary/Colonial and Revolutionary Maryland material, early church records, family papers, and, as well, the publisher of the leading journal of Chesapeake area research. &nbsp;Specifically, I recommend searching The Maryland Historical Magazine (quarterly since 1906) on their website and always considering their holdings via their catalog online when engaging in Maryland (or related Virginia, Delaware, Pennsylvania, Kentucky, Tennessee, and other research with historic and genealogical Maryland associations).</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 57, 57, 'und', 0, '<p>This rapidly expanding online presence seeks to make available the public contents of the numerous Italian regional archives under the auspices of the Italian national archives system (La Direzione Generale per gli Archivi). &nbsp;Most important to our research, many of the microfilmed civil vital records (and intentions, allegations) previously available only available on visits to Italy are now digitized on this site. &nbsp;Also, censuses of about 1800 and a growing military records collection are on the site. &nbsp;Vital records are organized by branch archive and by period, i.e., lo stato civile (the civil registry) of the Napoleonic (stato civile napoleonico), restoration (stato civile della restaurazione), and Kingdom of Italy/republican eras (stato civile italiano), together spanning approximately the years 1796/1799/1800 (depending on the location) through at least the early twentieth century. &nbsp;Such records have allowed me to reconstruct ancestry of Americans and others with previously unknown ancestry in Italy before the immigrant generations.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 58, 58, 'und', 0, '<p>This is likely the most important manuscript collection accessible in the United States. &nbsp;As well, its Austria/Germany and Malta study centers include microfilmed manuscripts (and often digitized materials) which make available sources for research on the nobility and hereditary elites (many in your own ancestry and among your ancestral kin), the Church, and, for our purposes, too, in heraldry. &nbsp;Most recently, HMML has undertaken to rescue and preserve manuscript material from the destruction of ISIS and other destructive forces in the Middle East.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 59, 59, 'und', 0, '<p>A how-to on tracing early Virginia ancestry. I spoke about the long presence of the Lees of Virginia in Alexandria and vicinity, and presented efforts of Ann Woodard Fox and Alice Carter Lee revealing how present-day Americans share in the remarkable heritage of colonial America’s leading families, the planters of Virginia and Maryland.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 60, 60, 'und', 0, '<p>The presentation followed the course of tracing two families in Bergen, Essex, Hudson, and Passaic Counties, one back to its nineteenth-century immigrant ancestors, accounting for the incorporation of new boroughs, families being recorded in neighboring boroughs or even in New York City based upon their work of associations, name corruptions, and a family structure garbled and confused in censuses and others records; the other family traced through several generations of immigrants back to a colonial family otherwise unknown to descendants which had origins in colonial New England.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 61, 61, 'und', 0, '<p>An introduction to authentic (rather than fanciful) heraldic research for the genealogical community.</p>', '', 'filtered_html'),
('node', 'ct_media_appearance', 0, 62, 62, 'und', 0, '<p>Participant in discussion and commentary on family history and the role it plays in cohesion between families and even in marriages; how composite family origins and American national identity emerged from the immigration era through military service, common identity in Western civilization and Judeo-Christian religious background, the “American work ethic” (rather than the “Protestant work ethic,” which is a misnomer), and unifying pride in an American homeland. &nbsp;Genealogical origins of families were considered.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 63, 63, 'und', 0, '<p>The poetry and other writing of New York City clerk Josiah Shippey (1778-1848) chronicle his life and the lives of his relatives. &nbsp;Genealogical proof is presented demonstrating that Josiah’s grandmother Elizabeth (Briggs) Shippey descended from John and Priscilla (Mullins) Alden, Mayflower passengers.</p>', '', 'filtered_html'),
('node', 'experts', 0, 65, 65, 'und', 0, '<p>He is Chief Genealogist of the New England Historic Genealogical Society since 1993, a weekly radio personality on “Extreme Genes” Family History Radio and podcast <a href="#">www.extremegenes.com</a>, and a recognized international speaker in the field of genealogy and history. David is also the author and co-author of six books, and dozens of articles in print and online. He is currently a Fellow of the Massachusetts Historical Society; Life member: New Hampshire Society of the Cincinnati; Massachusetts chapter of the Sons of the Revolution; Stoughton Historical Society (Stoughton, Mass.); and the Massachusetts Archeological Society. David is the tribal genealogist for the Massachusett-Punkapoag Indians.</p>', '', 'full_html'),
('node', 'ct_resource', 0, 66, 66, 'und', 0, '<p>This resource has many original Massachusetts documents not found anywhere else.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 67, 67, 'und', 0, '<p>Ability to access original Military records relating to the Revolutionary War through the 20th century.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 68, 68, 'und', 0, '<p>Over 2 million rolls of microfilm for around the world for genealogists and historians.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 69, 69, 'und', 0, '<p>An overview of the land, court and probate records for New England.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 70, 70, 'und', 0, '<p>Lecture on the pirates that plagued the New England Coast from 17th – 18th centuries.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 71, 71, 'und', 0, '<p>An overview of the 19th and 20th century State Census returns to be used as an alternative to the Federal Census for genealogists.</p>', '', 'filtered_html'),
('node', 'ct_media_appearance', 0, 72, 72, 'und', 0, '<p>Each week I share the news in the genealogy field, and offer a “Tech Tip” to assist family historians.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 73, 73, 'und', 0, '<p>A comprehensive guide to Massachusetts cemeteries and their records.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 74, 74, 'und', 0, '<p>The vital records of Stoughton, Norfolk Co., Massachusetts from 1726-1850.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 75, 75, 'und', 0, '<p>An illustrated history of Stoughton, Massachusetts in the 20th century.</p>', '', 'filtered_html'),
('node', 'experts', 0, 76, 76, 'und', 0, '<p>She joined NEHGS in 2012, and has been the Director of Research Services since 2016. In addition to helping constituents with their research, Lindsay has also authored a Portable Genealogists on the topics of Applying to Lineage Societies, the United States Federal Census, 1790-1840 and the United States Federal Census, 1850-1940. She is a frequent contributor to the NEHGS blog, Vita-Brevis, and has appeared as a guest on the Extreme Genes radio program. Before, NEHGS, Lindsay worked at the National Archives and Records Administration in Waltham, Massachusetts, where she designed and implemented an original curriculum program exploring the Chinese Exclusion Era for elementary school students. She holds a B.A. from Merrimack College and M.A. from the University of Massachusetts-Boston.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 77, 77, 'und', 0, '<p>From the Great Migration Study Project to Elements of Genealogical Analysis, RCA provides the best, most current research for those arriving in New England from 1620-1640. It is always my first stop when I begin early New England research.</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 78, 78, 'und', 0, '<p>Ever wonder why your ancestor was enumerated as Austrian one year and Italian the next? To learn more about the enumeration process, the United States Census Bureau website includes the exact instructions that were handed out to enumerators, the questions asked, and how the census sheets were archived. This resource is essential for those interested in the US Census.&nbsp;</p>', '', 'filtered_html'),
('node', 'ct_resource', 0, 79, 79, 'und', 0, '<p>Seeing that New York is one of the harder states for research, this database includes information about ALL of the individuals included on a probate record. That’s right- witnesses, neighbors, heirs- all are included in this wonderful resource.&nbsp;</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 80, 80, 'und', 0, '<p>Genealogy is one of the most valuable pursuits in which you can participate—learning about who you are, where you come from, and meeting the thousands of people who came before you, can be a rewarding and even life-changing experience. But, how do you get started? You may have inherited family papers or research from a relative, have dabbled on a number of websites, or started your research and have already found a few records of interest. What''s next? There are plenty of websites, libraries, and printed sources out there, but access to all that information can leave a beginner feeling overwhelmed. In this course you''ll learn how to navigate the first steps in tracing your family history and gain basic strategies for researching and recording data. Even if you''ve already been doing research for a few years, I''m sure you''ll learn a new tip or two!</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 81, 81, 'und', 0, '<p>The U.S. federal census is an essential resource for family historians researching 19th- and 20th-century ancestors. To get the most out of the census, it''s important to understand its context and shortcomings. Join Director of Research Services Lindsay Fulton for an overview of the federal census, plus valuable search tips and techniques.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 82, 82, 'und', 0, '<p>Researchers often ignore the 1790-1840 U.S. Federal Census, but they shouldn''t. This lecture will discuss the tabulation of the 1790-1840 U.S. Federal Census, the records that survive, and the questions that were asked during each enumeration. The lecture will identify specific censuses that should be used to identify your ancestors, as well as follow up record collections. A case study tracing a family and their migration using the 1790-1840 U.S. Federal Census will also be included.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 83, 83, 'und', 0, '<p>Researchers often ignore the 1790-1840 U.S. Federal Census, but they shouldn''t. This lecture will discuss the tabulation of the 1790-1840 U.S. Federal Census, the records that survive, and the questions that were asked during each enumeration. The lecture will identify specific censuses that should be used to identify your ancestors, as well as follow up record collections. A case study tracing a family and their migration using the 1790-1840 U.S. Federal Census will also be included.</p>', '', 'filtered_html'),
('node', 'ct_media_appearance', 0, 84, 84, 'und', 0, '<p>How to apply to lineage societies.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 85, 85, 'und', 0, '<p>This Portable Genealogist provides information on a number of lineage societies, the general application process, and tips for finding missing links.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 86, 86, 'und', 0, '<p>This Portable Genealogist provides background on the 1790–1840 U.S. Federal Census tabulation process, surviving records, enumeration questions (by year), as well as hints for using the census to break down brick walls.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 87, 87, 'und', 0, '<p>This Portable Genealogist provides background on the 1850–1940 U.S. Federal Census tabulation process, the records that survive, enumeration questions (by year), as well as general information about federal non-population schedules.</p>', '', 'filtered_html'),
('node', 'experts', 0, 88, 88, 'und', 0, '<div style="font-size: 13.008px; line-height: 20.0063px;">She is a nationally recognized professional genealogist&nbsp;<span style="font-size: 13.008px; line-height: 1.538em;">and lecturer specializing in New England and&nbsp;</span><span style="font-size: 13.008px; line-height: 1.538em;">celebrity research as well as computerized genealogy; is compiler of more than 120 celebrity family trees; has been a contributing editor for Heritage Quest Magazine, Biography magazine and was a contributor to The History Channel Magazine and American History Magazine. In addition to numerous articles, she is the author of 13 books, including the award-winning The Complete Idiot''s Guide to Online Genealogy, in its second edition, Finding Your Famous and Infamous Ancestors, and The History of the Brigham Family: Descendants of Thomas Brigham. Areas of expertise: Immigration and naturalization, Late 19th and early 20th Century urban research, Missionaries (primarily in association with the American Board of Commissioners of Foreign Missions), State Department Federal Records, New England, Mid-West, Southern, German, Italian, Scottish, Irish, French Canadian, New Brunswick, and European research as well as Internet research, genealogical software (FTM, RootsMagic, Reunion), digital peripherals, and uses both Mac and Windows machines.</span></div><div>&nbsp;</div>', '', 'filtered_html'),
('node', 'ct_resource', 0, 89, 89, 'und', 0, '<p>A major historical archive in early American, Massachusetts and New England history, it has many church records on deposit in addition to a number of valuable manuscript collections.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 90, 90, 'und', 0, '<p>A look at how to and the importance of incorporating online research with traditional research in physical repositories.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 91, 91, 'und', 0, '<p>Using the various insignias, ephemera and papers found on tombstones, in family heirlooms and family papers, what they tell you about the fraternal groups your ancestors joined, in addition to how to search for potential records and the information these records may have about your ancestors.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 92, 92, 'und', 0, '<p>An overview of the church, vital, land, notarial records and compiled genealogies that are useful in researching French Canadian ancestry.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 93, 93, 'und', 0, '<p>How useful land records can be in researching your family tree, includes a case study that took a family from the Midwest back to colonies of New Jersey and Massachusetts through the use of just land records.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 94, 94, 'und', 0, '<p>How to take information on your Italian immigrants and identify them back in Italy, as well as what records to expect in the old country.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 95, 95, 'und', 0, '<p>An introduction to the varied records and resources of schools, hospitals, jails, orphanages, and retirement homes among others and how they can be used in researching your family history.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 96, 96, 'und', 0, '<p>A look at the experience our immigrant ancestors faced and the records that were generated that can assist in identifying the town of origin, or potentially additional family names, coupled with where to find these records.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 97, 97, 'und', 0, '<p>&nbsp;An overview of the how to research your German ancestors. Week 1 looked at research in the United States, Week 2 discussed the handwriting and fonts, Week 3 discussed working with the records in Germany.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 98, 98, 'und', 0, '<p>NEHGS Webinar (Boston, MassachuA look at some important features and the overall feel of programs to help those beginning to look for a genealogical program as well as how to move data from one program to another.setts)</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 99, 99, 'und', 0, '<p>In depth concentration on working with records in the United States to identify the Italian origins of your immigrant ancestors, followed by a look at the variety of records generated in Italy, how to use them, where to find them, and more.</p>', '', 'filtered_html'),
('node', 'ct_lecture', 0, 100, 100, 'und', 0, '<p>In depth concentration on working with French Canadian records, looking at identifying parishes for church records, and other resources including an entire class devoted to notarial records.</p>', '', 'filtered_html'),
('node', 'ct_media_appearance', 0, 101, 101, 'und', 0, '<p>Interview with Mat on genealogical topics.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 102, 102, 'und', 0, '<p>Abstract of microfilmed will records for Rockbridge County, Virginia.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 103, 103, 'und', 0, '<p>A guide book to assist genealogists in getting the most out of their Family Tree Maker software.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 104, 104, 'und', 0, '<p>An introductory book on using the Internet in genealogy.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 105, 105, 'und', 0, '<p>A guide book to assist genealogists in getting the most out of their Family Tree Maker software.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 106, 106, 'und', 0, '<p>An introductory book on using computers for genealogists.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 107, 107, 'und', 0, '<p>A guide book to assist genealogists in getting the most out of their Family Tree Maker software.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 108, 108, 'und', 0, '<p><span style="font-size: 13.008px; line-height: 20.0063px;">Updated introductory book on using the Internet in genealogy</span></p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 109, 109, 'und', 0, '<p>A guide book to assist genealogists in getting the most out of their Family Tree Maker software.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 110, 110, 'und', 0, '<p>A book devoted to the many resources like newspapers, institutional records and more that can assist you in researching your ancestors of repute or ill-repute.&nbsp;</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 111, 111, 'und', 0, '<p>A guide book to assist genealogists in getting the most out of their Family Tree Maker software.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 112, 112, 'und', 0, '<p>A guide book to assist genealogists in information important in digitizing photos and other records, as well as hardware to acquire.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 113, 113, 'und', 0, '<p>A getting started guide for people interested in family history.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 114, 114, 'und', 0, '<p>An updated family history of the descendants of Thomas Brigham who arrived in Massachusetts in 1635. The last volume was published in 1928.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 115, 115, 'und', 0, '<p>A short guide to immigration resources and records for the United States.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 116, 116, 'und', 0, '<p>A short guide to methods and items to keep in mind when organizing family history research.</p>', '', 'filtered_html'),
('node', 'ct_publications', 0, 117, 117, 'und', 0, '<p>A short guide to records and resources on the naturalization of your ancestors in the United States.</p>', '', 'filtered_html');
