INSERT INTO `field_revision_field_home_page_bio` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_home_page_bio_value`, `field_home_page_bio_format`) VALUES
('node', 'experts', 0, 55, 55, 'und', 0, 'Christopher has more than 15 years of experience as a professional genealogist, and is widely published in the field. His areas of expertise include royal lineages, New England and the Great Migration.', NULL),
('node', 'experts', 0, 65, 65, 'und', 0, 'David is NEHGS''s Chief Genealogist and has over 25 years of experience. He lectures around the world, and co-hosts a weekly radio personality on “Extreme Genes” Family History Radio and podcast www.extremegenes.com.', NULL),
('node', 'experts', 0, 76, 76, 'und', 0, 'Lindsay became NEHGS''s Director of Research Services in 2016. She is an expert in Lineage Societies, and is a frequent contributor to the NEHGS blog, Vita-Brevis and the Extreme Genes radio show.', NULL),
('node', 'experts', 0, 88, 88, 'und', 0, 'Rhonda is a nationally recognized professional genealogist and lecturer specializing in New England and celebrity research, as well as computerized genealogy.', NULL);
