(55, 'node', ' christopher carter lee genealogist france georgia heraldry italian louisiana maryland medieval new jersey new york nobility north carolina poland russia spain tennessee ukraine virginia he joined nehgs as a fulltime genealogical researcher in 2014 from a career in foreign and public policy analysis primarily in campaigns and nonprofits and a homegrown business as a genealogical researcher he is a facilitator in boston university s genealogical research certificate program of which he is also an alumnus his commentary appeared in print and new media sources and he made appearances on cnn he has also worked for the us institute of peace and in program development for the archdiocese of newark having previously worked for the usccb confraternity of christian doctrine a graduate of georgetown university s foreign service program and graduate coursework at the elliott school of international affairs lee is a fluent speaker of several languages who is active in the european hereditary community including the corpo della nobilta italiana he volunteers with charitable organizations including mustard seed communities aid to the church in need the saint bernard project the indian health service the tekakwitha conference and other disasterrelief and foreignservice charities he facilitates a biweekly boston homeless effort and additional service for the sovereign order of malta antenati ancestors tier title recommended resources content maryland historical society antenati ancestors the hill museum and manuscripts library ancient timespresent tier title lecture topics content heraldry for genealogists early tidewater virginia and chesapeake research boroughitis genealogical research in late nineteenth and early twentieth century northern new jersey tier title lecture topics upcoming tier title media appearances content ewtn untitled family history segment tier title publications content elizabeth briggs shippey and her husband ishmael of raritan landing new jersey and their descendants through the specimens of josiah shippey cherokee genealogy oklahoma christopher has more than 15 years of experience as a professional genealogist and is widely published in the field his areas of expertise include royal lineages new england and the great migration  ', 0),
(56, 'node', ' maryland historical society the preeminent resource for maryland research mdhs was founded by the society of the cincinnati of maryland in 1844 and became the principal repository for proprietary colonial and revolutionary maryland material early church records family papers and as well the publisher of the leading journal of chesapeake area research specifically i recommend searching the maryland historical magazine quarterly since 1906 on their website and always considering their holdings via their catalog online when engaging in maryland or related virginia delaware pennsylvania kentucky tennessee and other research with historic and genealogical maryland associations baltimore maryland wwwmdhsorg  ', 0),
(57, 'node', ' antenati ancestors  this rapidly expanding online presence seeks to make available the public contents of the numerous italian regional archives under the auspices of the italian national archives system la direzione generale per gli archivi most important to our research many of the microfilmed civil vital records and intentions allegations previously available only available on visits to italy are now digitized on this site also censuses of about 1800 and a growing military records collection are on the site vital records are organized by branch archive and by period ie lo stato civile the civil registry of the napoleonic stato civile napoleonico restoration stato civile della restaurazione and kingdom of italy republican eras stato civile italiano together spanning approximately the years 179617991800 depending on the location through at least the early twentieth century such records have allowed me to reconstruct ancestry of americans and others with previously unknown ancestry in italy before the immigrant generations italy covering 1700s1900s http wwwantenatisanbeniculturaliit  ', 0),
(58, 'node', ' the hill museum and manuscripts library ancient timespresent  this is likely the most important manuscript collection accessible in the united states as well its austria germany and malta study centers include microfilmed manuscripts and often digitized materials which make available sources for research on the nobility and hereditary elites many in your own ancestry and among your ancestral kin the church and for our purposes too in heraldry most recently hmml has undertaken to rescue and preserve manuscript material from the destruction of isis and other destructive forces in the middle east collegeville minnesota http wwwhmmlorg  ', 0),
(59, 'node', ' early tidewater virginia and chesapeake research a howto on tracing early virginia ancestry i spoke about the long presence of the lees of virginia in alexandria and vicinity and presented efforts of ann woodard fox and alice carter lee revealing how presentday americans share in the remarkable heritage of colonial america s leading families the planters of virginia and maryland joe cobb saturday march 1 2008 christ church alexandria lyceum both alexandria virginia other location past only year  ', 0),
(60, 'node', ' boroughitis genealogical research in late nineteenth and early twentieth century northern new jersey the presentation followed the course of tracing two families in bergen essex hudson and passaic counties one back to its nineteenthcentury immigrant ancestors accounting for the incorporation of new boroughs families being recorded in neighboring boroughs or even in new york city based upon their work of associations name corruptions and a family structure garbled and confused in censuses and others records the other family traced through several generations of immigrants back to a colonial family otherwise unknown to descendants which had origins in colonial new england thursday march 1 2012 ridgewood public library ridgewood new jersey other location past only year  ', 0),
(61, 'node', ' heraldry for genealogists an introduction to authentic rather than fanciful heraldic research for the genealogical community tuesday march 1 2016 nehgs nehgs upcoming only year  ', 0),
