(76, 'node', ' lindsay fulton connecticut illinois lineage societies maine massachusetts midwest new england new hampshire new york ohio rhode island vermont she joined nehgs in 2012 and has been the director of research services since 2016 in addition to helping constituents with their research lindsay has also authored a portable genealogists on the topics of applying to lineage societies the united states federal census 17901840 and the united states federal census 18501940 she is a frequent contributor to the nehgs blog vitabrevis and has appeared as a guest on the extreme genes radio program before nehgs lindsay worked at the national archives and records administration in waltham massachusetts where she designed and implemented an original curriculum program exploring the chinese exclusion era for elementary school students she holds a ba from merrimack college and ma from the university of massachusettsboston getting started tier title recommended resources content anything by robert charles anderson united states census bureau abstracts of wills admins and guardianships in ny state 17871835 tier title lecture topics content how to search the 17901840 united states federal census successfully getting started using the us federal census how to search the 17901840 united states federal census successfully tier title lecture topics upcoming tier title media appearances content extreme genes tier title publications content applying to lineage societies using the federal census 17901840 using the federal census 18501940 india iraq lindsay became nehgs s director of research services in 2016 she is an expert in lineage societies and is a frequent contributor to the nehgs blog vitabrevis and the extreme genes radio show  ', 0),
