(80, 'node', ' getting started genealogy is one of the most valuable pursuits in which you can participate learning about who you are where you come from and meeting the thousands of people who came before you can be a rewarding and even lifechanging experience but how do you get started you may have inherited family papers or research from a relative have dabbled on a number of websites or started your research and have already found a few records of interest what s next there are plenty of websites libraries and printed sources out there but access to all that information can leave a beginner feeling overwhelmed in this course you ll learn how to navigate the first steps in tracing your family history and gain basic strategies for researching and recording data even if you ve already been doing research for a few years i m sure you ll learn a new tip or two tuesday march 1 2016 new hampshire historical society concord nh https wwwnhhistoryorg research genealogyaspx past monthyear  ', 0),
(81, 'node', ' using the us federal census the us federal census is an essential resource for family historians researching 19th and 20thcentury ancestors to get the most out of the census it s important to understand its context and shortcomings join director of research services lindsay fulton for an overview of the federal census plus valuable search tips and techniques monday february 1 2016 webinar nehgs https wwwyoutubecom watch v cku2nbrbxaw past monthyear  ', 0),
(82, 'node', ' how to search the 17901840 united states federal census successfully researchers often ignore the 17901840 us federal census but they shouldn t this lecture will discuss the tabulation of the 17901840 us federal census the records that survive and the questions that were asked during each enumeration the lecture will identify specific censuses that should be used to identify your ancestors as well as follow up record collections a case study tracing a family and their migration using the 17901840 us federal census will also be included monday february 1 2016 salt lake city rootstech 2016 https rootstech2016smarteventscloudcom connect speakerdetailww personid 1e51e6b8fd8355822a191e26c2283fb9 past monthyear  ', 0),
